import React from 'react';
import './App.css';
import { HashRouter, Switch, Route, Redirect, NavLink } from 'react-router-dom';
import { Menu } from 'antd';
import {
  MailOutlined,
  AppstoreOutlined,
  SettingOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;
const links = ['Input', 'Task List'];
function App() {
  return (
    <HashRouter>
      <header />
      <nav>
        <div>
          <Menu
            onClick={this.handleClick}
            selectedKeys={[this.state.current]}
            mode="horizontal"
          >
            {links.map((link) => (
              <Menu.Item className="headerLink" key={link} to={link}>
                {link}
              </Menu.Item>
            ))}
          </Menu>
        </div>
      </nav>
      <div className="app">
        <Switch>
          <Route render={() => <Redirect to="/Rooms" />} />
        </Switch>
      </div>
    </HashRouter>
  );
}

export default App;
